import React from 'react'
import { inject,observer } from 'mobx-react'
import './index.less'
import { RollbackOutlined } from '@ant-design/icons';
import { Button } from 'antd'
import Table from './Table';
import DetailList from './DetailList'

@inject('DeviceDefineStore',)
@observer
class DailyPage extends React.PureComponent{
  constructor(props){
    super(props)
    this.store = this.props.DeviceDefineStore;
    this.state = {
      visible : false,
    }
  }
  render(){
    return (
      <div>
        <div style={{marginBottom:'20px',borderLeft:'3px solid #6236FF',paddingLeft:'10px'}}>
          <span style={{fontSize:'16px',fontWeight:'600',marginRight:'10px'}}>运维日志 </span>
          <Button size='small' icon={<RollbackOutlined />} onClick={()=>this.store.isDaily = false}>返回</Button>
        </div>
        <DetailList 
          handleDetail = {this.handleDetail}
        />
        {
          this.state.visible && <Table
            visible = {this.state.visible}
            onCancel={this.onClose}
          />
        }
      </div>
    );
  }
  handleDetail = (id)=>{
    this.store.getDetailLog({logId:1}).then(()=>{
      this.setState({
        visible:true
      })
    })
  }
  onClose = ()=>{
    this.setState({
      visible:false
    })
  }
}

export default DailyPage
